import styled from 'styled-components'
import Image from 'next/image'

const CheckList = () => {

    return (
        <Container>
            <ContainerImage>
                <Image
                    src="/coding.png"
                    width={500}
                    height={500}
                />
            </ContainerImage>


        </Container>
    )

}

const Container = styled.div` 
    display: flex;
    flex-direction: column;
`
const ContainerImage = styled.div`
    height: 60%;
    width: 60%;
    max-width: 400px;
    max-height: 400px;
    align-items: space-evenly
`

export default CheckList
